import{_ as c}from"./chunks/PageInfo.vue_vue_type_script_setup_true_lang.576d70b4.js";import{_ as t,o as d,c as r,H as a,k as e,a as p,Q as s}from"./chunks/framework.d8868ba7.js";import"./chunks/commonjsHelpers.725317a4.js";const Q=JSON.parse('{"title":"常见问题","description":"","frontmatter":{},"headers":[],"relativePath":"Extra/FAQ.md","filePath":"Extra/FAQ.md","lastUpdated":1704123475000}'),l={name:"Extra/FAQ.md"},n=e("h1",{id:"常见问题",tabindex:"-1"},[p("常见问题 "),e("a",{class:"header-anchor",href:"#常见问题","aria-label":'Permalink to "常见问题"'},"​")],-1),i=s('<blockquote><p>Q: 安装<code>gsuid_core</code>的时候，输入命令<code>poetry install</code>出现报错<code>DBusErrorResponse</code></p><p>A: 输入命令<code>export PYTHON_KEYRING_BACKEND=keyring.backends.null.Keyring</code>之后再次尝试<code>poetry install</code></p></blockquote><blockquote><p>Q: 使用命令中报错<code>No such file or directory</code></p><p>A: 缺少相关资源文件夹，可尝试使用命令<code>gs重启</code>或者<code>下载全部资源</code>，如仍然报错，请提供错误日志并反馈</p></blockquote><blockquote><p>Q: 启动出现报错<code>SSLCertVerificationError</code>，但是Bot可以正常使用</p><p>A: 涉及功能<code>深渊概览</code>，缺少SSL证书，进入<a href="https://akashadata.feixiaoqiu.com/static/data/abyss_total.js" target="_blank" rel="noreferrer">虚空数据库</a>后点击左上角、链接左边的小锁，<code>链接是安全的 -&gt; 证书有效 -&gt; 详细信息 -&gt; 导出证书</code>, 然后文件名随便写一个，后缀改为<code>.crt</code>，双击安装证书即可</p></blockquote><blockquote><p>Q: 启动出现报错<code>Httpx AsyncClient Timeout Error</code>等，但是Bot可以正常使用</p><p>A: 涉及功能<code>版本深渊</code>, 网络无法连接内鬼网</p></blockquote><blockquote><p>Q: <code>签到</code>、<code>每日</code>等功能出现报错、或者错误码1034</p><p>A: 米游社采取全域验证码校验，需要手动上米游社解除验证码风控（我的 -&gt; 我的角色），<strong>目前暂无公开解决方法</strong></p></blockquote><blockquote><p>Q: 群友使用命令无反馈、仅自己可用</p><p>A: 使用<code>重置core配置</code>后重启</p></blockquote><blockquote><p>Q: 使用<code>gs帮助</code>无反应，其他命令有效</p><p>A: 使用<code>gs重启</code>重新加载帮助图（大概率是由于更新后不重启导致的）</p></blockquote><blockquote><p>Q: 能不能一次性更新<code>GenshinUID v4</code>和<code>gsuid-core（早柚核心）</code></p><p>A: 使用<code>gs全部更新</code>，如遇v4更新报错，可进一步使用<code>gs强制更新</code> （注意无法强制更新core、也不推荐在core目录下使用<code>git rm</code>、<code>git clean</code>等高危命令）</p></blockquote><blockquote><p>Q: 启动资源下载过慢，有没有离线资源包</p><p>A: 前往<a href="./ResourceDownload.html">资源包</a>下载最新文件覆盖</p></blockquote><blockquote><p>Q: Nonebot2的配置、添加适配器的教程</p><p>A: 请自行前往对应文档查看，例如<a href="https://nb2.baka.icu/" target="_blank" rel="noreferrer">NoneBot2文档</a>、以及各个适配器的文档，善用<a href="https://github.com" target="_blank" rel="noreferrer">GitHub</a>的搜索功能</p></blockquote><blockquote><p>Q: <code>ValueError: the greenlet library is required to use this function. DLL load failed while importing _greenlet: 找不到指定的模块。</code></p><p>A: 安装依赖<code>greenlet</code>（如果你是windows，还需要额外安装<code>msvc-runtime</code>）</p><p>视环境使用<code>poetry run pip install greenlet</code>或者<code>pip install greenlet</code>，<code>msvc-runtime</code>同理</p></blockquote><blockquote><p>Q: 能不能添加某个功能</p><p>A: 在GenshinUID的项目里提issuse，如果合理并且有余力，会加入<code>todo list</code></p></blockquote><blockquote><p>Q: 能不能修改<code>v4-nonebot2</code>连接到<code>core</code>的端口</p><p>A: 在nb2的环境文件中（例如<code>.env</code>）添加<code>gsuid_core_host=&quot;127.0.0.1&quot;</code>和<code>gsuid_core_port=&quot;9527&quot;</code>，IP地址和端口改成你需要的就可以</p></blockquote><blockquote><p>Q: 能不能修改<code>core</code>接受链接的端口</p><p>A: 在<code>gsuid_core/gsuid_core/config.json</code>中，调整IP和PORT后重启core</p></blockquote>',14);function u(_,b,k,g,q,h){const o=c;return d(),r("div",null,[n,a(o,{readTime:"2",words:"695"}),i])}const N=t(l,[["render",u]]);export{Q as __pageData,N as default};
